en chance for at komme ud i verdenen.\\nSom lejesvend/vagt lærte han våbenkunst og klarede sig godt ved at vide hvordan man undgår at blive overvåget og forfulgt.\\n\\nFor nyligt har han besluttet sig for at det er irrelevant at være vagt for han kan kun beskytte ting så længe han er der, og så snart han er væk kan alting gå galt alligevel. Uanset hvor mange banditter han slår ihjel kommer der bare flere så længe lederen som sidder hjemme i skjulet stadig er i live. \\nDerfor har han besluttet sig for at vende tilbage til sine evner som spion/agent og forhåbentligt gøre en forskel ved at gå efter mere strategiske mål som har indflydelse. Folk som korrupte politikere, bandit ledere og deslige\\n\\nSit kaldenavn \\logseq____&quot;[[Lark]]\\logseq____&quot; fik han som barn som kodenavn hos sin kontakt fordi han var god til at imitere fuglelyde/sang og holdt til i skovenlogseq____&quot;,536871044]],[logseq____&quot;^15logseq____&quot;,[1439,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^1@logseq____&quot;,536871044]],[logseq____&quot;^15logseq____&quot;,[1439,logseq____&quot;^Flogseq____&quot;,1433,536871044]],[logseq____&quot;^15logseq____&quot;,[1439,logseq____&quot;^Xlogseq____&quot;,21,536871044]],[logseq____&quot;^15logseq____&quot;,[1439,logseq____&quot;^Vlogseq____&quot;,21,536871044]],[logseq____&quot;^15logseq____&quot;,[1439,logseq____&quot;^Ulogseq____&quot;,21,536871044]],[logseq____&quot;^15logseq____&quot;,[1439,logseq____&quot;^?logseq____&quot;,[logseq____&quot;^ logseq____&quot;,logseq____&quot;^3Elogseq____&quot;,3],536871044]],[logseq____&quot;^15logseq____&quot;,[1439,logseq____&quot;^Jlogseq____&quot;,[],536871044]],[logseq____&quot;^15logseq____&quot;,[1439,logseq____&quot;^Hlogseq____&quot;,21,536871044]],[logseq____&quot;^15logseq____&quot;,[1439,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u66c77cf0-ee9c-4087-b53c-498ac40b8dealogseq____&quot;,536871044]],[logseq____&quot;^15logseq____&quot;,[1440,logseq____&quot;^Qlogseq____&quot;,l
